'The Perfect Planet and Other Stories'

Top Shelf Productions, 1999, 212 pages

Written and Illustrated by James Kochalka

This graphic novel showcases the Ignatz Award winning story, The Perfect Planet, as well two brand new stories, Nonironic Futuropolis, and Frog &amp; Fly. The Perfect Planet is a whimsical tale that explores the mysteries of life with all the love and wonder the human soul can muster. Nonironic Futuropolis will make you feel as magical as the first snowfall of winter. And Frog &amp; Fly is the quest for the Evil Toad Messiah. Together, this trilogy makes textbook reading for the serious Kochalka reader. Miss this at your own peril.


